(17,'Olivia Pointon','avaolivia2747@gmail.com','Explainer Videos','Hi,\r\n\r\nWe\'d like to introduce to you our explainer video service which we feel can benefit your site mem.com.np.\r\n\r\nCheck out some of our existing videos here:\r\nhttps://www.youtube.com/watch?v=ivTmAwuli14\r\nhttps://www.youtube.com/watch?v=uywKJQvfeAM\r\nhttps://www.youtube.com/watch?v=oPNdmMo40pI\r\nhttps://www.youtube.com/watch?v=6gRb-HPo_ck\r\n\r\nAll of our videos are in a similar animated format as the above examples and we have voice over artists with US/UK/Australian accents.\r\n\r\nThey can show a solution to a problem or simply promote one of your products or services. They are concise, can be uploaded to video such as Youtube, and can be embedded into your website or featured on landing pages.\r\n\r\nOur prices are as follows depending on video length:\r\n1 minute = $189\r\n1-2 minutes = $289\r\n2-3 minutes = $389\r\n\r\n*All prices above are in USD and include an engaging, captivating video with full script and voice-over.\r\n\r\nIf this is something you would like to discuss further, don\'t hesitate to reply back.\r\n\r\nKind Regards,\r\nOlivia','2021-08-12 19:14:46','2021-08-12 19:14:46'),
(18,'Kylie Hart','kyliehartila@yahoo.com','DA50 Backlink to mem.com.np','Hi, \r\n\r\nWe\'re wondering if you\'d be interested in a \'dofollow\' backlink to mem.com.np from our Moz DA50 website?\r\n\r\nOur website is dedicated to facts/education, and so can host articles on pretty much any topic.\r\n\r\nYou can either write a new article yourself, or we can link from existing content. The price is just $40 USD to be paid via Paypal. This is a one-time fee, so there are no extra charges.\r\n\r\nIf you\'re interested, please reply to this email, including the word \'interested\' in the Subject Field.\r\n\r\nNot sure what DA is? Have a read here: https://moz.com/learn/seo/domain-authority\r\n\r\nKind Regards,\r\nKylie','2021-08-16 05:56:56','2021-08-16 05:56:56'),
