INSERT INTO `pages` (`id`, `title`, `description`, `created_at`, `updated_at`) VALUES (1,'Privacy Policy','Protecting your personal information is important but due to the nature of our business, some functions and services offered through our site and mobile apps require that suppliers or customers provide certain personal information such as email address, postal, phone numbers, etc for communication purposes and the information collected by mem.com.np and its affiliates (including mobile apps) are the only information provided to us voluntarily.\r\n\r\nWe do not sell any personal information to third parties and we never will.\r\nWe will not disclose your personal information, unless (I) with your prior written consent; (II) in accordance with the applicable laws and regulations, or where required by competent authorities; (III) as required to offer the Services; or (IV) to protect its legitimate interests, for example, to defend its rights on administrative or judicial procedures or in case its business or parts thereof is transferred to sold to another party.\r\n\r\nWe may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal, or regulatory reasons.','2021-02-21 08:38:41','2023-01-05 13:38:22'),
(2,'Return Policy','While we make every effort to describe all our products as accurately as possible, we accept that occasionally not all items received are as you expected. So, if you are not 100% satisfied with your purchase for any reason, feel return then you can.\r\nAll returned or exchanged items must be:\r\n1) New and unused conditions with all original tags & labels attached.\r\n2) Must include all packing materials, warranty cards, manuals, and \r\n     accessories.\r\n3) All returns must be postmarked within 7 days of the purchase date.','2021-02-21 08:39:33','2023-01-05 13:40:23'),
