(4,'Payment Policy','By using the Online Purchase, you agree to the following: -\r\n•   The information provided is correct and accurate.\r\n•    We will not be responsible for any damage suffered by you from the use of \r\n      the services on this site.','2021-06-05 08:46:48','2023-01-05 13:43:49'),
